import React from "react";
import Link from "@mui/material/Link";
import "./Upload.scss";

const Upload = () => {
  return (
    <Link href="https://www.tunecore.com/">
      <button className="upload__button">Upload</button>
    </Link>
  );
};

export default Upload;
